import React from 'react';
import { useState, useEffect, useRef } from 'react';
import "./ParentHomePage.css";
import { useHistory } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';

function ParentHomePage() {
    let history = useHistory();

    function handleChildCardBtn(){
        history.replace("/MyChildCard");
    }

    function handleChildAttendance(){
        history.replace("/ChildAttendance");
    }

    return(
        
        <div className="container">
            <meta name="viewport" content="width=device-width, initial-scale=1"></meta>
        <p id="ParentHomePageParagraph"><Button type="button" onClick={handleChildCardBtn}>Child Card</Button></p>
        <p className="ParentHomePageParagraph"><button type="button" onClick={handleChildAttendance}>Child Attendance/Absence</button></p>
        <p className="ParentHomePageParagraph"><button type="button">Track Vehicle</button></p>
        <p className="ParentHomePageParagraph"><button type="button">Contact Accompanying Person</button></p>
        </div>
    )
}
export default ParentHomePage;
